import React, { Component } from 'react';
import Navbar from './Navbar';
import News from './News';

import{
  Link
}from 'react-router-dom';

class Homepage extends Component {
  render() {
    return (


    <div>
    <Navbar />
        <div>
      <h1>
      <Link to="/Blog">Japan</Link>
      </h1>

      <p>
      Insert bio for it
      </p>
      </div>


<div>
  <h1>
    <Link to="/Blog2">Italy</Link>
  </h1>
<p>
This will be the 2nd blog post and will go to the 2nd page. Please and thank you.
</p>

</div>

<div className="blog">
  <h1>
  <Link to="/Blog3">Belgium</Link>
  </h1>
  <img src="https://www.worldatlas.com/r/w728-h425-c728x425/upload/3e/cb/41/brussels.jpg" alt="Belgium">
  </img>
  <p>
  Belgium is a wonderful place and here are a few spots where you should check out.
  </p>
</div>

    <News />
      </div>



    );
  }
}

export default Homepage;
